INSERT INTO `tbl_message` (`id`, `dateEnvoi`, `objet`, `message`, `auteur`, `client_id`) VALUES
(5, '2017-02-10', 'Test', 'Test', 94, 8),
(6, '2017-02-11', 'Échange PR', 'Salut Mike, c\'est pour t\'informer d\'un échange de quart de PR, P-O Brown prend mon chiffre du mardi 14 et je prends son mercredi 22.\r\n\r\nMerci !\r\n\r\nBenoit Gagnon 141\r\n418-999-2920', 94, 8),
(7, '2017-02-14', 'Commande de vêtements', 'Bonjour à tous,\r\n\r\nce message est pour vous informer que dès demain vous aurez à votre disposition de votre pigeonnier un formulaire de commande de vêtements. Celui-ci me servira à passer vos commandes avec les différents fournisseurs et me permettra également de traiter vos demandes plus efficacement.\r\n\r\nVous devez remplir cette feuille seulement si vous avez besoin de commander des articles. Vérifier plus particulièrement vos pantalons, chemises et bottes car cette commande devrait normalement arriver avant le début des visites de prévention.\r\n\r\nAprès avoir compléter le formulaire, veuillez le déposer dans l\'ancienne boîte de suggestion, maintenant boîte de commande de vêtements blue/black. Assurez-vous d\'avoir bien remplis le questionnaire et de façon lisible. Veuillez inscrire la grandeur de l\'article désiré seulement si il y a changement depuis votre dernière commande. La section commentaire vous permettra d\'y inscrire par exemple : trous au niveau de l\'entrejambe, chemise décoloré, bris suite à une intervention, etc.\r\n\r\nN\'oubliez pas que nous avons un droit de regard sur les articles que vous passerez en commande et qu\'ils ne seront par commandé si nous pensons qu\'il y a abus. À titre d\'exemple un pompier temps partiel ne devrait pas avoir usé suffisamment une paire de botte après un an d\'utilisation.\r\n\r\nJe ramasserai les formulaires de commande le 1 mars 16h00. Après cela il sera trop tard pour commandé, à moins d\'une situation exceptionnelle. \r\n\r\nMerci de votre habituelle collaboration.\r\n\r\nBenoit Gagnon 141\r\n418-999-2920', 94, 8),
(8, '2017-02-15', 'tâche PR 18-19 février 2017', 'Bonjour à vous et merci de votre présence à cette activité.\r\n\r\nLe 18-19 février de au parc de glisse du grand héron.\r\n\r\nResponsable Alain Vézina\r\n\r\nLe 18 février Maxime Fortin et William Bélanger  de 8 h 30 à 17H00\r\nLe 19 février Mélanie Lévesque et William Bélanger e 9 h 30 à 17H00\r\n\r\nLe véhicule 910 sera à votre disposition et la trousse du 1010 et matériel médical sera utiliser.\r\n\r\nUn plan des lieux est inclus et sera disponible papier dans le 910\r\n\r\nUne clé de l’infirmerie du centre Desjardins vous sera remis pour vous réchauffé et y mettre le matériel médical sensible au gel.\r\n\r\n\r\n\r\nPlus de détail à venir\r\n', 93, 8),
(9, '2017-02-15', '', 'Bonjour à vous et merci de votre présence à cette activité.\r\n\r\nLe 18-19 février de au parc de glisse du grand héron.\r\n\r\nResponsable Alain Vézina\r\n\r\nLe 18 février Maxime Fortin et William Bélanger  de 8 h 30 à 17H00\r\nLe 19 février Mélanie Lévesque et William Bélanger e 9 h 30 à 17H00\r\n\r\nLe véhicule 910 sera à votre disposition et la trousse du 1010 et matériel médical sera utiliser.\r\n\r\nUn plan des lieux est inclus et sera disponible papier dans le 910\r\n\r\nUne clé de l’infirmerie du centre Desjardins vous sera remis pour vous réchauffé et y mettre le matériel médical sensible au gel.\r\n\r\n\r\n\r\nPlus de détail à venir\r\n', 93, 8),
(10, '2017-02-15', 'Sac de fontainier 212', 'Bonjour à tous! Petite mise à jour pour le sac de fontainier du véhicule 212. Il est dorénavant situé à l’arrière du camion à droite. Cela le rend plus accessible. \r\n\r\nMerci et bonne journée \r\n', 96, 8),
(11, '2017-02-15', 'Pratique', 'Bonjours à tous. Simplement de ne pas oublié la pratique de se soir. Je vous attends pour 19:00hr dans la salle au deuxième étages.\r\n\r\nMerci \r\nLT Nicolas Tanguay 133', 82, 8),
(12, '2017-02-20', 'Uniforme', 'Bonjours a tous, simplement un petit rappel pour vous rappeler de porté vos uniformes complet lorsque vous êtes demandé a la caserne peu importe le type d\'évènement. \r\nPAYÉ=UNIFORME\r\n\r\nMERCI de votre collaboration\r\n\r\nLT Nicolas Tanguay\r\n133 \r\n', 82, 8),
(13, '2017-02-21', 'Disponibilité PR et pompier', 'Bonjour a tous vous êtes inviter a compéter vos disponibilité via SGP pour les pompiers le reste de février et mars le plus tôt possible.\r\nPour les PR mettre vos disponibilités de mars comme celle envoyé conventionnellement afin de tester les corrections des problèmes rencontrer la semaine dernière. \r\nMerci de votre collaboration\r\n\r\n ', 93, 8),
(14, '2017-02-22', 'prise de mesure bunker', 'bonjour a tous une date a été retenue pour la prise de mesure de votre bunker neuf.\r\nSeulement le 20 mars a été retenue du au dispos du représentant.\r\n\r\n20 mars de 14:00 a 22:00\r\n\r\nil serait intéressant de condensé le tout.\r\n\r\nenvoyé moi vos dispos de cette plage.\r\nPour ceux ou il sera impossible une entente devra être prit avec M.Lavoie', 82, 8),
(15, '2017-02-22', 'dispo de PR', 'j\'ai fais l\'horaire malgré que les dispo PR n\'étaient pas sur SGP je m\'attend a ce quelles y soient pour le mois d\'avril comme le logiciel SGP est fonctionnel a présent.\r\n\r\nMerci', 93, 8),
(16, '2017-02-23', 'lumières de parking', 'Bonjours a tous \r\nSimplement pour vous avertir que dorénavant les lumières de parking sur tout les véhicule munis de master devront être laisser ouvert.\r\n\r\nLe master fera la job pour les fermés, cela évitera de partir le soir sans qu\'aucune lumières soit allumé autre que vos gyrophares.\r\n\r\nMerci \r\nLT Nicolas Tanguay\r\n133', 82, 8),
(17, '2017-02-23', 'Évaluation ', 'Salut les gars j\'aurai besoin de vous rencontré pour votre évaluation et se le plustôt possible. Je n\'ai seulement que la semaine prochaine de jours pour réglé se dossier. Je sais sa nous laisses pas beaucoup de temps et veuillez m\'excuser c mon erreur. Svp bien vouloir me transmettre une journée que vous seriez dispo de jour pour me rencontré. L-m-m-j. En espérant le tout possible pour vous. \r\nMerci \r\nLT Tanguay\r\n', 82, 8),
(18, '2017-02-23', '', 'Désolé mon dernier e-mail s\'adresse seulement à Denis côté- Dany houde-Jo Savard- Martin Baillargeon -Ben Villeneuve.  \r\nMerci bonne soirée', 82, 8),
(19, '2017-02-23', '', 'Désolé mon dernier e-mail s\'adresse seulement à Denis côté- Dany houde-Jo Savard- Martin Baillargeon -Ben Villeneuve.  \r\nMerci bonne soirée', 82, 8),
(20, '2017-02-25', 'Nouveaux opérateurs', 'Bonjour à tous, suite à une formation donnée cette semaine d\'une durée de trois heures (conduite et opération) les pompiers Brown, Lajeunesse et Fortin sont désormais opérateur/chauffeur du véhicule anciennement appelé 711.\r\n\r\nBenoit Gagnon 141', 94, 8),
(21, '2017-02-25', 'operation', 'Bonjour Chef\r\n\r\noperation pour mon herni completé avec succes le 17 fev\r\n\r\nsuivi avec chirgurgien le 16 mars\r\n\r\nretour aux operations prévu 20 mars\r\n\r\nj ai hâte pas mal..\r\n\r\na plus\r\n\r\nmartin baillargeon\r\n', 101, 8),
(22, '2017-02-25', 'Demande de formation', 'Salut Alain, j\'ai eu une demande de David Lajeunesse afin de passer la formation d\'opérateur/chauffeur sur le véhicule 211 je crois ... l\'ancien 710.\r\n\r\nBenoit Gagnon 141', 94, 8),
(23, '2017-03-06', 'Prise de mesure Martin & Lévesques', 'Bonjour à tous, ceci est pour vous informé qu\'un représentant de Martin & Lévesques sera à la caserne le lundi 20 mars à 18h00 pour prise de mesure.\r\n\r\nJe vous rappel que cette démarche est dans l\'optique de réduire les erreurs de commande et que nous nous engageons à faire venir sur place notre fournisseur deux fois pour année. De cette façon si vous n\'avez pas pus vous présenter la première fois vous pourrez y aller à la deuxième.\r\n\r\nMerci de votre collaboration habituelle.\r\n\r\nBenoit Gagnon 141\r\n418-999-2920', 94, 8),
(24, '2017-03-08', 'Essais', 'TEST TEST TEST', 94, 8),
(25, '2017-03-08', 'test', 'peux tu répondre si tu reçoit ce message merci', 93, 8),
(26, '2017-03-08', 'test', 'test test test', 93, 8),
(27, '2017-03-08', 'test', 'test test test \r\n\r\nconfirme reception stp', 93, 8),
(28, '2017-03-08', 'test', 'test test test\r\n\r\nconfirme reception stp ', 93, 8),
(29, '2017-03-08', 'test test test ', 'test test test ', 93, 8),
(30, '2017-03-08', 'test', 'test test test ', 93, 8),
(31, '2017-03-08', 'test', 'test', 93, 8),
(32, '2017-03-13', 'Disponibilités PR', 'Mes disponibilités sont envoyer \r\nMerci\r\nSébastien Tétreault \r\n\r\n6-7-17soir-20-21', 91, 8),
(33, '2017-03-17', 'certification module 0', 'Bonjour à vous certain m\'ont répondu, il y aura une certification PR module 0 REA à Ste-Brigitte de Laval le jeudi 23 mars 2017 de 18h00 à 22h00 approximativement les heures peuvent changer légèrement c\'est la dernière chance cette année pour pour certifié module 0. J\'aimerais que vous y assisté pour mettre votre dossier PR à jour pour les module 2 et 7 a venir contactez moi rapidement que je puisse vous cédulé SVP\r\n\r\nmerci\r\n\r\n418-930-9450', 93, 8),
(34, '2017-03-20', 'DISPO PR', 'Bonjour à vous je n\'ais pas reçu vos dispo PR pour avril j\'en ai besoin aujourd\'hui SVP je test SGP \r\n\r\nMerci de votre collaboration\r\n\r\nMike:)', 93, 8),
(35, '2017-03-20', 'DISPO PR', 'J\'ai trouvé vos dispo sauf un, elles étaient dans force de frappe cet onglet ne gère que le coté pompier pour les pr vous devez partir de HORAIRE, DISPONIBILITÉ, PREMIER RÉPONDANT, et ensuite coché\r\nje sais que pour certain ça ne fonctionne pas je regarde ce problème avec le technicien\r\n\r\nMerci ', 93, 8),
(36, '2017-03-20', 'Horaire PR SGP', 'J\'ai fais l\'ébauche de l\'horaire sur SGP\r\n\r\nIl y aura des modifications à venir alors si vous ne voyez pas votre numéro pas de stress.\r\nj\'ai priorisé les nouveau afin de les exposé un peu alors soyez compréhensif si vous n\'avez pas le nombres de gardes désiré nous sommes en période d\'ajustement \r\n\r\nMerci', 93, 8),
(37, '2017-03-20', 'certification PR', 'Salut JP\r\n\r\nOn se recertifie les 18-19-20 avril pour le module 2 ACP et les 25-26-27 avril 2017 pour le module 7 IND/ENV \r\ndésire tu poursuivre tes certifications si oui choisi moi quelques dates et je t\'inclus\r\n\r\nMerci', 93, 8),
(38, '2017-03-22', 'Horaire PR SGP', 'Bonjour les PR\r\n\r\nVoici l\'horaire sur SGP Il a été très compliqué de faire l\'horaire afin de tester SGP ce n\'est pas encore concluant il reste plusieurs problèmes à régler. Je n\'envoie plus l\'horaire conventionnelle, mais elle sera affiché à la caserne pour le temps de garde et d\'intervention. \r\nPour traduire les numéro de pompier prenez la feuille des numéro de téléphone que tous avez reçu de Marie-Josée. \r\nLes changements seront restreint ce mois ci a cause de l\'intégration des nouveau ils seront accordé en cas de force majeur seulement, les changements se feront sur SGP et en caserne sur l\'horaire affiché. \r\nVous devrez obtenir une autorisation pour les changements respectez vos disponibilités SVP.\r\n\r\nJe serais en vacance du 30 mars au 17 avril alors l\'officier de garde ou Capt Beaumont seront là pour toutes questions\r\n\r\nMerci', 93, 8),
(39, '2017-03-23', 'test', 'testtttt', 93, 8),
(40, '2017-03-24', 'Changement PR', 'Salut c\'est changé le jeudi 30 mars soir de Nick à  Ben.\r\n\r\nMerci', 93, 8),
(41, '2017-03-28', 'Cabane à sucre ', 'Bonjour à tous je fais mon dernier rappel pour la cabane à sucre, vous avez jusqu\'à ce jeudi 30 mars 09h00 pour me confirmer votre présence ou votre absence au brunch style cabane à sucre du samedi 08 avril 11h00.\r\n\r\nMerci de votre compréhension. \r\n\r\nMaxime Mondoux ', 96, 8),
(42, '2017-03-29', 'remolacement pr', 'Jacques Fiset remplace Karel ce soir avec Maxime Fortin comme PR\r\n\r\nMerci', 93, 8),
(43, '2017-04-24', 'dispo PR mai 2017', 'salut Bastien je n\'ai pas reçu tes dispo de mai ???', 93, 8);
