--
-- Structure de la table `tbl_parametres`
--

CREATE TABLE `tbl_parametres` (
  `id` int(11) NOT NULL DEFAULT '1',
  `heureMaximum` int(11) DEFAULT NULL,
  `nbJourPeriode` varchar(45) DEFAULT NULL,
  `moduloDebut` int(11) DEFAULT NULL,
  `dateDebutPeriode` date DEFAULT NULL,
  `service` varchar(150) NOT NULL,
  `caserne` varchar(75) NOT NULL,
  `moduloDepotDispo` tinyint(3) UNSIGNED DEFAULT NULL,
  `moisFDF` tinyint(4) NOT NULL,
  `dernierAlerteFDF` datetime DEFAULT NULL,
  `dateDebut` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `colonne` varchar(15) NOT NULL DEFAULT 'matricule',
  `ordre` varchar(4) NOT NULL DEFAULT 'ASC',
  `heureMinimum` int(11) NOT NULL DEFAULT '0',
  `listeDispo_Equipe` tinyint(1) NOT NULL DEFAULT '1',
  `garde_horaire` int(11) NOT NULL,
  `garde_fdf` int(11) NOT NULL,
  `timezone` varchar(100) NOT NULL,
  `caserne_horaire` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0:tous;1:usager;',
  `nbJourHoraireFixe` int(11) NOT NULL DEFAULT '0',
  `defaut_fdf` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:dispo;1:non-dispo;',
  `affichage_fdf` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:caserne;1:service',
  `grandEcran_fdf` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0:non;1:présent',
  `grandEcran_horaire` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0:non;1:présent',
  `grandEcran_horaire_dateDebut` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:date du jour;1:début période;',
  `grandEcran_nbr_periode_horaire` tinyint(1) NOT NULL DEFAULT '1',
  `dateDebutCalculTemps` date DEFAULT NULL,
  `eve_dispo` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:Dispo Evenement;1:Dispo Horaire',
  `grandEcran_style` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:normal;1:gros',
  `dispoParHeure` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0:Oui;1:Non',
  `colonneGauche` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:Non;1:Oui',
  `droitVoirDispoHoraire` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:Gestionnaire;1:Pompier',
  `maxDateReculRapport` date NOT NULL COMMENT 'Avant cette date les données ne sont pas valides',
  `horaireCalculHeure` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:Semaine;1:Période',
  `documentValidation` varchar(10) DEFAULT NULL,
  `dispo_fdf_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:caserne;1:service;',
  `affichage_fdf_equipe` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:Garde;1:Nom equipe;',
  `congeHeureMax` int(11) NOT NULL,
  `siCalculHeureHoraire` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0:Non;1:Oui;',
  `fdf_minimum_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:Ordre;1:Individuelle;',
  `fdf_equipe_spe` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0:Service;1:Caserne;',
  `client_id` int(1) NOT NULL DEFAULT '8',
  `dispo_horaire_debarre` int(1) NOT NULL DEFAULT '0',
  `caserne_defaut_horaire` int(11) DEFAULT NULL,
  `caserne_defaut_fdf` int(11) DEFAULT NULL,
  `horaire_mensuel` int(1) DEFAULT '0',
  `fdf_garde_specialise` int(1) DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

